create or replace procedure "SCOTT"."prc_get_person"(    pv_nbr_tbl IN "SCOTT"."number_tbl"   ,pv_rset OUT SYS_REFCURSOR) ASBEGIN    open pv_rset for        select "prsn_id", "first_name", "last_name"        from "STRESS_person"        where "prsn_id" in (select column_Value from table(pv_nbr_tbl));END;
create or replace procedure "SCOTT"."prc_get_person_name"(   pv_last_name IN VARCHAR2  ,pv_name_tbl OUT "SCOTT"."string_tbl") ASBEGIN    select "first_name"    bulk collect into pv_name_tbl    from "STRESS_person"    where "last_name" = pv_last_name ;END;
