-- STRESS_Names.table
create sequence "SCOTT".".empno_seq." increment by 1 start with 1 nocache;
create table "SCOTT".".emp."(  ".empno."  NUMBER ,".ename."  VARCHAR2(50) ,".job."    VARCHAR2(50) ,".mgr."    NUMBER ,".hiredate." DATE ,".sal."    NUMBER ,".comm."   NUMBER ,".deptno." NUMBER);
create view "SCOTT".".emp_view." as  select * from "SCOTT".".emp.";
CREATE OR REPLACE PACKAGE "SCOTT".".emp_actions." AS   TYPE ".EmpRecTyp." IS RECORD (".emp_id." INT, ".salary." REAL);   PROCEDURE ".doNothing.";   CURSOR ".desc_salary." RETURN ".EmpRecTyp.";   TYPE ".MyCursor." IS REF CURSOR;   PROCEDURE ".get_employee."(      "..given_empno.." in NUMBER     ,"..EmpCursor.." OUT ".MyCursor."   );   PROCEDURE ".set_employee."(      "..given_empno.." in NUMBER   );   FUNCTION ".doNothingFunc."   RETURN NUMBER   DETERMINISTIC;   FUNCTION ".doNothingFunc!."(      "..FirstArgument.." NUMBER   )   RETURN NUMBER   DETERMINISTIC;   PROCEDURE ".hire_employee."(      "..ename.."  VARCHAR2     ,"..job.."    VARCHAR2     ,"..mgr.."    NUMBER     ,"..sal.."    NUMBER     ,"..comm.."   NUMBER     ,"..deptno.." NUMBER   );   PROCEDURE ".fire_employee."(      "..emp_id.." NUMBER   );   FUNCTION ".doubleMe."(      "..some_value.." NUMBER   )   RETURN NUMBER   DETERMINISTIC;   FUNCTION ".doubleMe."(      "..some_value.." VARCHAR2   )   RETURN VARCHAR2   DETERMINISTIC;   FUNCTION ".Really:Really~Really Ugly.!."(      "..some_value.." VARCHAR2   )   RETURN VARCHAR2   DETERMINISTIC;END ".emp_actions.";
ALTER PACKAGE "SCOTT".".emp_actions." compile specification;
CREATE OR REPLACE PACKAGE BODY "SCOTT".".emp_actions." AS   CURSOR ".desc_salary." RETURN ".EmpRecTyp." IS      SELECT ".empno.", ".sal." FROM ".emp." ORDER BY ".sal." DESC;   PROCEDURE ".doNothing."   IS   BEGIN      DELETE FROM ".emp." where 1 = 0;   END ".doNothing.";   PROCEDURE ".get_employee."(      "..given_empno.." IN NUMBER     ,"..EmpCursor.." OUT ".MyCursor."   )   IS   BEGIN      OPEN "..EmpCursor.." FOR      select * from "SCOTT".".emp.";   END ".get_employee.";   PROCEDURE ".set_employee."(      "..given_empno.." in NUMBER   )   IS   BEGIN      UPDATE ".emp." SET ".job." = ".job." || 'a' where "..given_empno.." = ".empno.";   END ".set_employee.";   FUNCTION ".doNothingFunc."   RETURN NUMBER   DETERMINISTIC   IS      result NUMBER;   BEGIN      result := 1;      return(result);   END ".doNothingFunc.";   FUNCTION ".doNothingFunc!."(      "..FirstArgument.." NUMBER   )   RETURN NUMBER   DETERMINISTIC   IS      result NUMBER;   BEGIN      result := 1;      return(result);   END ".doNothingFunc!.";   PROCEDURE ".hire_employee."(      "..ename.."  VARCHAR2     ,"..job.."    VARCHAR2     ,"..mgr.."    NUMBER     ,"..sal.."    NUMBER     ,"..comm.."   NUMBER     ,"..deptno.." NUMBER   )   IS   BEGIN      INSERT INTO ".emp." VALUES (".empno_seq.".NEXTVAL, "..ename..", "..job..", "..mgr..", SYSDATE, "..sal..", "..comm..", "..deptno..");   END ".hire_employee.";   PROCEDURE ".fire_employee."(      "..emp_id.." NUMBER   )   IS   BEGIN      DELETE FROM ".emp." WHERE ".empno." = "..emp_id..";   END ".fire_employee.";   FUNCTION ".doubleMe." (     "..some_value.." NUMBER   )   RETURN NUMBER   DETERMINISTIC   IS      result NUMBER;   BEGIN      result := 2 * "..some_value..";      return(result);   END ".doubleMe.";   FUNCTION ".doubleMe."(      "..some_value.." VARCHAR2   )   RETURN VARCHAR2   DETERMINISTIC   IS      result VARCHAR2(200);   BEGIN      result := "..some_value.." || "..some_value..";      return(result);   END ".doubleMe.";   FUNCTION ".Really:Really~Really Ugly.!."(      "..some_value.." VARCHAR2   )   RETURN VARCHAR2   DETERMINISTIC   IS      result VARCHAR2(200);   BEGIN      result := "..some_value.." || "..some_value..";      return(result);   END ".Really:Really~Really Ugly.!.";END ".emp_actions.";
ALTER PACKAGE "SCOTT".".emp_actions." compile body;

call "SCOTT".".emp_actions.".".hire_employee."('Bob', 'Odd Job', null, null, null, null);

