declare  idx number(5) := 0;  limit number(5) := 10;  lob_pos number;  str varchar2(100);  str_len number;  MyLocalNClob NCLOB;begin  insert into "SCOTT"."STRESS_NCLOB" values (    "SCOTT"."STRESS_NCLOB_SEQ".nextval    , EMPTY_CLOB()    )    returning "nclob_default" into MyLocalNClob;  lob_pos := 1;  for idx in 0..limit loop    str := to_char(idx) || ': Hello world' || chr(10);    str_len := length(str);    dbms_lob.write(MyLocalNClob, str_len, lob_pos, str);    lob_pos := lob_pos + str_len;  end loop;end;

